//TestSuite
log.info testRunner.testCase.testSuite.getPropertyValue("Name")
testRunner.testCase.testSuite.setPropertyValue("Name","I am in TestSuite")

//TestCase
log.info testRunner.testCase.getPropertyValue("Name")
testRunner.testCase.setPropertyValue('Name','I am in TestCase')

//TestStep
log.info testRunner.testCase.getTestStepByName("MyProp").getPropertyValue("Name")
testRunner.testCase.getTestStepByName("MyProp").setPropertyValue("Name","I am in Test Step")

//Global
log.info com.eviware.soapui.SoapUI.globalProperties.getPropertyValue( "Name")
com.eviware.soapui.SoapUI.globalProperties.setPropertyValue( "Name","I am in Global Prop" )


